/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function(s, t) {
    // t的字符是固定的，我们先计算
    let winFreq = {} // 滑动窗口的字符-》次数
    const tFreq = getFreq(t)  // t的字符-》次数
    let left=0, right=t.length-1;
    let minContainStr = s // 初始化为原始字符串s
    let hasContainFlag = false
    while(right <= s.length){
        // 先右移
        while(right <= s.length){
            right++;
            let win = s.slice(left, right)
            winFreq = getFreq(win)
            if(!isContain(winFreq, tFreq)){
                // 不包含的一直右移
                continue
            } else {
                // 找到了包含t中全部字符的
                hasContainFlag = true
                if(win.length < minContainStr.length){
                    minContainStr = win
                }
                break
            }
        }
        // 接下来左移
        while(left <= right){
            left++;
            let win = s.slice(left, right)
            winFreq = getFreq(win)
            if(isContain(winFreq, tFreq)){
                // 包含的一直左移
                if(win.length < minContainStr.length){
                    minContainStr = win
                }
                continue
            } else {
                // 找到了包含t中全部字符的
                break
            }
        }

    }
    return hasContainFlag ? minContainStr : ''
    
};

/**
 * 获取字符串对应的字符-次数字典
 */
function getFreq(t){
    const freq = {}
    for(let i = 0; i < t.length;i++){
        freq[t[i]] = (freq[t[i]] === undefined) ? 1 : (freq[t[i]]+1)
    }
    return freq
}

/**
 * 判断窗口中字符是否全部包含了字符串t
 */
function isContain(winFreq, tFreq){
    for(let key in tFreq){
        if(!winFreq[key] || winFreq[key] < tFreq[key]) return false
    }
    return true
}
let s = "",
    t = "";

const res = minWindow(s, t)
console.log('res',res)
